import React, { Component } from "react";

export class Watch extends Component {
  state = {
    watch: {}
  };

  componentDidMount() {
    this.setState({ watch: this.props.watch });
  }
  render() {
    const { watch } = this.props;
    return <div>Hello</div>;
  }
}

export default Watch;
